* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}
* {
  transition: all 0.3s;
}
html {
  background-color: #ffe600;
}

#demo {
  position: fixed;
  top: 50%;
  left: 0;
  overflow: scroll;
  height: 50vh;
  background-color: #fff;
  min-width: 100%;
  padding-left: 10px;
}
#demo::-webkit-scrollbar {
  display: none;
}

#button {
  position: fixed;
  top: 55%;
  right: 40px;
  display: flex;
  flex-direction: column;
}
#button > button {
  margin-bottom: 10px;
  padding: 10px 10px;
}

@keyframes wave {
  0% {
    transform: rotateZ(0deg);
  }
  33% {
    transform: rotateZ(10deg);
  }
  66% {
    transform: rotateZ(-10deg);
  }
  100% {
    transform: rotateZ(0deg);
  }
}

.nose {
  position: relative;
  top: 145px;
  width: 0px;
  height: 0px;
  border: 10px solid black;
  border-color: black transparent transparent;
  border-bottom: none;
}
.yuan {
  position: absolute;
  top: -16px;
  right: -10px;
  width: 20px;
  height: 6px;
  border-radius: 10px 10px 0 0;
  background-color: black;
}
.nose {
  margin-left: -10px;
  left: 50%;
}
